import React, { Component } from "react";
import InvoiseOne from "./InvoiseOne";
import InvoiseTwo from "./InvoiseTwo";
import InvoiseThree from "./InvoiseThree";
import InvoiseFour from "./InvoiseFour";


export default class Father extends Component {

    state = {
        bool: 1
    }

    oneFunc = () => {
        this.setState({
            bool: 1
        })
    }

    twoFunc = () => {
        this.setState({
            bool: 2
        })
    }

    threeFunc =  () => {
        this.setState({
            bool: 3
        })
    }

    fourFunc =  () => {
        this.setState({
            bool: 3
        })
    }


  render() {
    return (
      <div>
        <button onClick={this.oneFunc}>invoise One</button>
        <button onClick={this.twoFunc}>invoise Two</button>
        <button onClick={this.threeFunc}>invoise Three</button>
        <button onClick={this.fourFunc}>invoise Four</button>

        <br /><br />

        {
            this.state.bool === 1 ? <InvoiseOne/> : this.state.bool === 2 ? <InvoiseTwo/> : this.state.bool === 3 ? <InvoiseThree/> : this.state.bool === 4 ? <InvoiseFour/> : <InvoiseOne/>
        }

      </div>
    );
  }
}
